import { Component } from 'react';
import styled from 'styled-components';

const Wrapper = styled.section`
        padding: 1.5em;
        margin: 0 10%;
        color: palevioletred;
        text-align: center;
`;

const Global = () => {
  return (
      <Wrapper>
          {this.props.children}
      </Wrapper>
  )
}

export default Global;
